import React, { useState, useEffect } from  'react';
import axios from 'axios';
import { Navigate } from 'react-router-dom';
import { makeStyles } from '@mui/styles';
import { Typography, Button, Grid, TextField } from '@mui/material'

import DisplayAppBar from './DisplayAppBar';

export default function HomePage() {
    const [data, setData] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8000/test/")
        .then(response => {
            console.log(response.data)
            setData(response);
        })
        .catch(error => {
            console.log(error);
        })
    }, []);

    return (
        <Grid container>
            <Typography variant="h1" color="primary">{data.id}</Typography>
            <Typography variant="h1" color="primary">{data.username}</Typography>
            <Typography variant="h1" color="primary">{data.email}</Typography>
            <Typography variant="h1" color="primary">{data.password}</Typography>
        </Grid>
    )
};
